import React, { useState } from "react";
import "./style.css";

function FetchApi() {

    const [data, setData] = useState();


const apiGet = () => {
    fetch('https://jsonplaceholder.typicode.com/posts')
    .then(response => response.json())
    .then(json => {
        console.log(json);
        setData(json);
    });
};

    return (

    <div>
        <h1>Click This button to fetch data </h1>
        
        <br />
        <button className="fetch-class" onClick={apiGet}>Fetch Data</button> <br />
        <pre>{JSON.stringify(data, null, 2)}</pre>
    </div>

    );
}

export default FetchApi;
